export default class AuthService {
  constructor(http) {
    this.http = http;
  }

  async login(username, password) {
    console.log(this.http);
    console.log(username, password);
    return this.http.fetch(`/auth/signup`, {
      method: "POST",
    });
    // return {
    //   username: "ellie",
    //   token: "abc1234",
    // };
  }

  async me() {
    return {
      username: "ellie",
      token: "abc1234",
    };
  }

  async logout() {
    return;
  }

  async signup(username, password, name, email, url) {
    return {
      username: "ellie",
      token: "abc1234",
    };
  }
}
